import { useAuth0 } from "@auth0/auth0-react";
import React from "react";
import { Route, Routes } from "react-router-dom";
import { PageLoader } from "./components/page-loader";
import { AuthenticationGuard } from "./components/authentication-guard";
import { CallbackPage } from "./pages/callback-page";
import { HomePage } from "./pages/home-page";
import { NotFoundPage } from "./pages/not-found-page";
import { ProfilePage } from "./pages/profile-page";
import { PublicPage } from "./pages/public-page";
import { ConnectPage } from "./pages/connect-page";
import { DashboardPage } from "./pages/dashboard-page";

export const App = () => {
  const { user, isLoading, isAuthenticated } = useAuth0();

  if (isLoading) {
    return (
      <div className="page-layout">
        <PageLoader />
      </div>
    );
  }

  if (!isAuthenticated) {
    return (
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/callback" element={<CallbackPage />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    );
  } else if (isAuthenticated && user.user_type === "admin") {
    return (
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/profile"
          element={<AuthenticationGuard component={ProfilePage} />}
        />
        <Route
          path="/dashboard"
          element={<AuthenticationGuard component={DashboardPage} />}
        />
        <Route path="/public" element={<PublicPage />} />
        <Route
          path="/users"
          element={<AuthenticationGuard component={ConnectPage} />}
        />
        <Route
          path="/classes"
          element={<AuthenticationGuard component={ConnectPage} />}
        />
        <Route path="/callback" element={<CallbackPage />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    );
  } else if (isAuthenticated && user.user_type === "student") {
    return (
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/profile"
          element={<AuthenticationGuard component={ProfilePage} />}
        />
        <Route
          path="/dashboard"
          element={<AuthenticationGuard component={DashboardPage} />}
        />
        <Route path="/public" element={<PublicPage />} />
        <Route
          path="/classes"
          element={<AuthenticationGuard component={ConnectPage} />}
        />
        <Route path="/callback" element={<CallbackPage />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    );
  } else if (isAuthenticated && user.user_type === "instructor") {
    return (
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/profile"
          element={<AuthenticationGuard component={ProfilePage} />}
        />
        <Route
          path="/dashboard"
          element={<AuthenticationGuard component={StudentDashboardPage} />}
        />
        <Route path="/public" element={<PublicPage />} />
        <Route
          path="/classes"
          element={<AuthenticationGuard component={ConnectPage} />}
        />
        <Route path="/callback" element={<CallbackPage />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    );
  }
};
